                    Child's age in months  - <div id="aim">&nbsp;</div>
<script src="includes/jmesa/jquery.min.js"></script>
<script>
$.noConflict();
jQuery(document).ready(function($) { 
 var fldDob = $("#dob").parent().parent().find("input");
 var fldAim = $("#aim").parent().parent().find("input");
 function calcAim(){
  var now = new Date();
  var yearNow = now.getFullYear();
  var monthNow = now.getMonth();
  var dayNow = now.getDate();
  var dateParts = fldDob.val().split("-");
  var yearDob = dateParts[2];
  var monthDob = dateParts[1]-1;
  var dayDob = dateParts[0];
  var dim = (yearNow-yearDob)*12 + (monthNow-monthDob);
  if(dayNow < dayDob){dim = dim - 1;}
  if(fldAim != dim){
   fldAim.val(dim);
   fldAim.change();
  }
 }

 function showButton(){
  if (fldAim.val() == ""){
   $("#aim").html("<input type='button' value='calculate' class='button' id='btnCalcAim'> Based on today's date!");
  }
 }
showButton();
$("#btnCalcAim").click(function(){
 calcAim();
});
})
</script>

                    Body height average  - <div id='ha' valign='top'></div>
<script src="includes/jmesa/jquery.min.js"></script>
<script>
$.noConflict();
jQuery(document).ready(function($) { 
 var fldH1 = $("#h1").parent().parent().find("input");
 var fldH2 = $("#h2").parent().parent().find("input");
 var fldHa = $("#ha").parent().parent().find("input");
 function calcAvg(){
  var avg = (parseFloat(fldH1.val())+parseFloat(fldH2.val()))/2;
  if(fldHa != avg){
   fldHa.val(avg);
   fldHa.change();
  }
 }

 function showButton(){
  if (fldH1.val() != "" && fldH2.val() != ""){
   $("#ha").html("cm <input type='button' value='calculate' class='button' id='btnCalcAvg' width='120px'>");
   $("#btnCalcAvg").click(function(){
    calcAvg();
   });
  }
  else{
   $("#ha").html("cm");
  }
 }
showButton();
fldH1.keyup(function(){
  showButton();
  });
fldH2.keyup(function(){
  showButton();
  });
})
</script>
